/**
 * @param {string} topic string that identifies the sensor and the measurment  
 * @param {number} measument value from the AI module of the AES from 0..20mA in the range to 0...30000
 */
function mapInputToRange(topic, value){
    // 0..20 mA = 0...30000 
    const mA20 = 30000
    // => 4mA = 30000 * 4/20 = 30000 * 0.2 = 6000 
    const mA4  = 6000
    // broken cable
    // => 3.5mA = 30000 * 3.5/20 = 5250 
    const mA3_5 = 5250

    const measurmentRange = mA20 - mA4

    // scaling factor for the measurement 
    const scaleMap = {
        Steam: 60 / measurmentRange,
        ColdWater: 2000 / measurmentRange,
        HotWater: 10000 / measurmentRange,
        SoftWater: 20000 / measurmentRange,
        H2O2: 12 / measurmentRange
    }

    const digitMap = {
        Steam: 2,
        ColdWater: 0,
        HotWater: 0,
        SoftWarter: 0,
        H2O2: 2
    }

    if (topic && scaleMap[topic]) {
        let payload = {}

        payload.mAReading = Number((value / mA20 * 20).toFixed(2))

        if (value < mA3_5) {
            payload.error = "LOW_CURRENT"
        }
        // scale and trim to fixed length
        payload.value = Number(((value - mA4) * scaleMap[topic]).toFixed(digitMap[topic]))
        // everythin below 4mA is calculated as a 0 measurement 
        if (payload.value < 0){
            payload.value = 0
        }
        return payload
    }

    throw new Error(`The key / topic ${topic} was not found in the scale map!`)
}


