            if (data.payload.length === 1) {
                data.payload.push({})
            }
            data.payload[1]['ERROR-' + msg.topic] = measurment.error
        }
        context.set('DATA', data)
    } catch (error) {
        node.send([null, {payload: error.message}])
    }


}

