function fixedDigits(value){
    let fixed = parseFloat(value.toFixed(3))
    return fixed
}

function verifyInput(min,max){
    if (min>max){
        let change = max
        min = max
        max = change
    }
    if (min===max){
        min = min - 1
    }    
    if (min < 0){
        min =0
    }
    if (max <= 0){
        max = 1
    }return [min,max]
}

function verifyTemp(min,max){
    if (min>max){
        let change = max
        min = max
        max = change
    }
    if (min===max){
        min = min - 1
    }return [min,max]
}

function updateValue(min, max, value, change) {
    if (value<min){
        value=min
    }
    let maxBorder = value + change;
    if (max<maxBorder) {
        maxBorder=value-(2*change)
    }
    let minBorder = value - change;
    if (min>minBorder) {
        minBorder=value+(2*change)
    }
    return Math.random() * (maxBorder - minBorder) + minBorder
}

function updateMax (value, last){
    if (value>last){
        last=value
    }
    return fixedDigits(last)
}

function updateMean (value , last){
    if (last==0){
        last=value
    }
    let mean = (value + last) /2
    return fixedDigits(mean)
}

